import React from "react";
import classes from "./Login.module.css";

const Login = () => {
  return (
    <div>
      <div className={classes.container}>
        <div className={classes.loginBox}>
          <div>I'm login Box</div>
        </div>
      </div>
    </div>
  );
};

export default Login;
